import axios from 'axios'
import { useEffect, useRef, useState } from 'react'

const InforStudent = (props) => {
  return (
    <div
      style={{
        flex: 1,
        display: 'flex',
        justifyContent: 'center',
        alignItems: 'center',
        flexDirection: 'column',
      }}
    >
      <div
        style={{
          display: 'flex',
          flexDirection: 'column',
          height: 300,
          width: 300,
          color: '#eaffff',
        }}
      ></div>
    </div>
  )
}

export default InforStudent
